const rawOutput = $('Be Star Ticketing Agent').first().json.output || '';
let parsed = { details: false, message: rawOutput, booking_data: null };
try {
  let cleaned = rawOutput.trim();
  if (cleaned.startsWith('```')) { cleaned = cleaned.replace(/```json?\n?/g, '').replace(/```/g, '').trim(); }
  const obj = JSON.parse(cleaned);
  parsed.details = obj.details === true;
  parsed.message = obj.message || '';
  parsed.booking_data = obj.booking_data || null;
} catch (e) { parsed.details = false; parsed.message = rawOutput; }
return [{ json: parsed }];
